  height: 480px;
  margin-left: 120px;
  margin-top: 128px;

  background: #FFFFFF;
  border-radius: 4px;
`

export const CartLogoComponent = styled(CartLogo)`
  position: absolute;
  margin-left: 154px;
  margin-top: 170px;
`

export const EmptyTitle = styled.text`

`

export const EmptySubtitle = styled.text`

`
